import React from "react";
import { Link } from "react-router-dom";
import {useEffect, useState} from 'react'
import axios from "axios";
const baseUrl='http://127.0.0.1:8000/api/elearning';
function Footer() {

    const [pageData, setpageData]=useState([]);
    useEffect(()=>{
        try{
            axios.get(baseUrl+'/pages/').then((res)=>{
                setpageData(res.data)
            })

          }catch(e){
            console.log(e)
          }
        },[])
    return (

    <footer className="test-muted py-5 container-fluid main_container mt-3 mx-5">
        <hr />
        <div className="container">
            <ul class="nav justify-content-center border-bottom pb-3 mb-3">
            <li class="nav-item"><a href="/" class="nav-link px-2 text-muted">Home</a></li>
            <li class="nav-item"><a href="/faq" class="nav-link px-2 text-muted">FAQs</a></li>
            {pageData.map((row, index)=>
                <li class="nav-item"><Link to={`/page/${row.id}${row.url}`} class="nav-link px-2 text-muted">{row.title}</Link></li>
            )}

            </ul>
            <p class="text-center text-muted">Â© 2022 Didactic, Inc</p>
        </div>
    </footer>
    );
  }

  export default Footer;
